@just_geen chats with Gymshark athletes @chanelcocobrown and @ajahzi on their personal experiences in the fitness industry, how we can move forward to make it a more inclusive place and (at the end) shoutout some women in the industry that are currently killing it. Life in the Fitness Industry intends to create positive, impactful change through conversation. The views and opinions expressed by the panel of speakers within the IGTV are based on their own personal experiences. They do not reflect the views or opinions of Gymshark. 
